import React, { Component } from 'react';
import jam from '../jam.png';

class Main extends Component {
    render() {
        return (
            <div id="content" className="mt-3">
                <table className="table table-borderless text-muted text-center">

                    <thead>
                        <tr>
                            <th scope="col"> Balance Stakings</th>
                            <th scope="col"> Staking Profit</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>{window.web3.utils.fromWei(thos.props.stakingBalance, 'Ether')} JAM</td>
                            <td>{window.web3.utils.fromWei(thos.props.stellareTokenBalance, 'Ether')} STE</td>
                        </tr>
                    </tbody>
                </table>
            </div>

        );
    }
}
